import React from "react";
import styles from './NewTaskForm.module.css';
import classes from './SubtaskForm.module.css';

const SubtaskForm = props =>{

    return (
        <form>
             <div className={styles['new-task-inputs']}>
                <div className={classes['sub-task-title']}>
                    <div className={classes['sub-task-heading']}></div>
                    <label className={styles["sub-heading"]}>Sub-task title:</label>
                    <input className={classes["title-input"]} type="text" />
                </div>

             </div>
        </form>

    );
}

export default SubtaskForm;
